var reverseString = function (s) {
  if (s.length === 0 || s.length === 1) return s;
  let left = 0,
    right = s.length - 1;
  while (left < right) {
    let temp = s[left];
    s[left] = s[right];
    s[right] = temp;
    left++;
    right--;
  }
  return s;
};
